svg.script:
var slide = {
    numpage: 1,
    oldlayer: 1,
    numpagemax: 4,
    init: function( rev ) {
        slide.numpagemax = parseInt(document.getElementById("tspanpage").firstChild.nodeValue);
	slide.moveToPage(1);
	document.getElementById("Top").onclick = function(evt) {
	    slide.moveToPage(1);
	}
	document.getElementById("Prev").onclick = function(evt) {
	    slide.moveToPage(slide.numpage-1);
	}
	document.getElementById("Next").onclick = function(evt) {
	    slide.moveToPage(slide.numpage+1);
	}
    },
    moveToPage: function(pa) {
        slide.oldlayer = slide.numpage;
        if (pa<1) {pa = slide.numpagemax};
        if (pa>slide.numpagemax) {pa = 1};
        slide.numpage = pa;
        document.getElementById("tspanpage").firstChild.nodeValue = ''+pa;
        slide.hideLayer(''+this.oldlayer);
        slide.showLayer(''+pa);
    },
    majText: function(id, libelle) {
        var elt = document.getElementById(id);
        var groupe = elt.parentNode;
        var nouveau = elt.cloneNode(true);
        if (nouveau.firstChild == null) {
          nouveau.appendChild(document.createTextNode(libelle));
        } else {
          nouveau.replaceChild(document.createTextNode(libelle), nouveau.firstChild);
        }
        groupe.replaceChild(nouveau, elt);
    },
    showLayer: function(layerid){
	document.getElementById("layer"+layerid).style.display="inline";
    },
    hideLayer: function(layerid){
	document.getElementById("layer"+layerid).style.display="none";
    },
}
  function play() {
    slide.init(); 
}
